description:
Verenigde Staten / Canada
Avontuur / Science-Fiction
98 minuten

een goeie film

met Richard Dean Anderson, Amanda Tapping en Cliff Simon

Terwijl SG-1 de executie van Ba'al, de laatste systemlord van de Goa'ulds bijwoont, verdwijnen Teal'c en Vala op een 
onverklaarbaar reden. Carter, Daniel en Mitchell reizen terug naar een wereld waar geschiedenis is veranderd en het Stargate 
project van de tijdlijn is gewist. Terwijl zij de autoriteiten proberen te overtuigen van wat er is gebeurd, komt er een vloot 
van Goa'uld moederschepen op aarde af, geleid door Ba'al, zijn koningin Qetesh en zijn rechterhand Teal'c.:
